import React from 'react';
import styled from 'styled-components';

const Container = styled.div`
  text-align: center;
  padding: 20px;
  background-color: #1a1a1a;
  color: white;
`;

const Header = styled.header`
  margin-bottom: 40px;
`;

const Title = styled.h1`
  font-size: 2.5em;
`;

const Subtitle = styled.p`
  font-size: 1.2em;
`;
const CirclesContainer = styled.div`
  display: flex;
  justify-content: center;
  flex-wrap: wrap;
  gap: 20px;
`;

const Circle = styled.div`
  width: 250px;
  height: 250px;
  border-radius: 50%;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: ${props => props.color};
`;

const Choice = ()=>{
    return (
        <Container>
        <Header>
          <Title>Have a look Around!</Title>
          <Subtitle>And you will find everything you need to build a great looking website</Subtitle>
        </Header>
        <CirclesContainer>
          <Circle color="#ff6b6b">
            {/* Red circle content */}
          </Circle>
          <Circle color="#51cf66">
            {/* Green circle content */}
          </Circle>
          <Circle color="#fcc419">
            {/* Yellow circle content */}
          </Circle>
        </CirclesContainer>
      </Container>
      );
}
export default Choice;
